// Get the original data from the Google Sheets trigger node
// Using $('Row updated').all() to reference the trigger directly,
const originalItems = $('Row updated').all();

// Loop through every item received from the Google Sheet node
return originalItems.map(item => {
  const data = item.json;

  // Prepare the human-readable document content
  // This formats the prospect message and response for the knowledge base
  const documentText = `Prospect's message: "${data.content}"

How to respond:

${data.response_sent}`;

  // Return the structured object for the vector store
  // - content: the text to be embedded and stored
  // - metadata: additional fields for filtering/retrieval
  return {
    json: {
      content: documentText,
      metadata: {
        type: data.type,
      }
    }
  };
});

